import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import { Link } from "react-router-dom";
import { useState } from "react";

const Customers = () => {
    const [writingDirection, setWritingDirection] = useState("ltr");
    const [customers, setCustomers] = useState([]);
  return (
    <><Navbar />
    <main>
        <section id="customer-page" class="khamco-section" dir={writingDirection}>
            <div class="utilities">
                <Link to="/customers/create/new-customer">
                    New Customer<i class="fas fa-user-plus"></i>
                </Link>
                <p class="message">
                    {message}
                </p>
            </div>
            <div class="utilities">
                <form action="/customers" method="GET" class="search-engine">
                    <input type="text" placeholder="Search Customer Name" name="name"/>
                    <button type="submit"><i class="fas fa-search"></i></button>
                </form>
                <form action="/customers" method="GET" class="search-engine" id="date-form">
                    <input type="date" name="date" id="date-search"/>
                    <button type="submit"><i class="fas fa-check"></i></button>
                </form>
                <form action="/customers" class="search-engine">
                    <input type="text" name="phone" id="phone" placeholder="Search Customer Phone Number"/>
                    <button type="submit"><i class="fas fa-check"></i></button>
                </form>
                <form action="/customers" class="search-engine">
                    <input type="text" name="uniqueId" placeholder="Search Customer ID"/>
                    <button type="submit"><i class="fas fa-check"></i></button>
                </form>
            </div>
            <h1 class="title">Customer List</h1>
            { customers.length > 0 &&
                customers.map((customer, index) => (
                        <div class="flex-wrapper" dir="auto" key={index}>
                        <p><strong>Name</strong>{customer.name}
                                {customer.surname}
                                {customer.membership_status === "VIP" &&
                                 <i class="fas fa-star blink"></i>
                                }
                        </p>
                        <p><strong>Last Measurement</strong>: {customer.measurements[0].date_created.toLocaleDateString('en-us',
                                {month: 'long' , year: 'numeric' , day:'numeric'})}
                        </p>
                        <p><strong>Mobile</strong>: <a href="tel:<%= customer.phone %>">
                                {customer.phone}
                            </a></p>
                        <p><strong>Dependents</strong>{customer.dependents.length}
                        </p>
                        <a href="/customers/<%=customer._id%>" class="edit-btn">View</a>
                        </div>
                ))}
                    {customers.length < 0 && <p class="empty">No customer data.</p>
                            }

        </section>
    </main>
    <Footer /></>
  )
}

export default Customers
